import { useParams } from 'react-router';

export default function DetailsPage() {

    const params = useParams()// for using params 

    return (
        <div style={{background:"yellow", width:"400px", height:"400px"}}>
            <h2>Details Page</h2>
            First Name: {params.fname}<br/>
            Last Name: {params.lname}<br/>
            City: {params.city}<br/>


        </div>
    )
}
